-- Table structure for des_desktop_group
-- ----------------------------
DROP TABLE IF EXISTS `des_desktop_group`;
CREATE TABLE `des_desktop_group` (
  `uuid` varchar(50) NOT NULL COMMENT '桌面组uuid',
  `resource_pool_uuid` varchar(50) DEFAULT '' COMMENT '资源池uuid',
  `desktop_type` char(3) DEFAULT '' COMMENT '桌面类型：VDI VOI',
  `name` varchar(20) DEFAULT '' COMMENT '桌面组名称',
  `type` varchar(10) DEFAULT '' COMMENT '桌面组类型：VDI(common-普通桌面组 pool-桌面池) VOI(share-共享 exclusive-独享)',
  `start_desktop_no` int(5) DEFAULT NULL COMMENT '起始桌面数量',
  `max_desktop_no` int(5) DEFAULT NULL COMMENT '最大桌面数量',
  `remain_desktop_no` int(5) DEFAULT NULL COMMENT '剩余空闲数量',
  `strategy_info` text DEFAULT NULL COMMENT '策略数据',
  `desktop_info` text DEFAULT NULL COMMENT '桌面池的云桌面数据',
  `template_uuid` varchar(50) DEFAULT NULL COMMENT 'voi模板机UUID',
  `network_uuid` varchar(50) DEFAULT NULL COMMENT 'voi网络UUID',
  `recovery_mode` tinyint(2) DEFAULT NULL COMMENT 'voi还原模式（0-否 1-是）',
  `recovery_type` varchar(50) DEFAULT NULL COMMENT '还原盘类型（systemDisk-系统盘，shareDisk-共享盘）',
  `default_desktop_uuid` varchar(50) DEFAULT NULL COMMENT 'voi默认进入桌面（模板机）uuid',
  `description` varchar(255) DEFAULT '' COMMENT '描述',
  `default_flag` tinyint(2) NOT NULL DEFAULT 0 COMMENT '默认桌面组：0-否 1-是',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `createpin` varchar(255) DEFAULT '' COMMENT '创建人',
  `updatetime` datetime DEFAULT NULL COMMENT '修改时间',
  `updatepin` varchar(255) DEFAULT '' COMMENT '修改人',
  `yn` tinyint(2) DEFAULT 1 COMMENT '删除状态：0-已删除 1-未删除 2-删除异常',
  PRIMARY KEY (`uuid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='桌面组';

